import { FiMapPin } from "react-icons/fi";

import * as S from "./styles";
import roomImg from "../../images/room.jpg";

export const Room = () => {
  return (
    <S.Room>
      <img src={roomImg} alt="" />
      <S.Info>
        <S.Title>The People's Brownstone</S.Title>
        <S.Address>
          <FiMapPin /> 1995 Broadway, New York
        </S.Address>
        <S.Description>
          Wifi • Air conditioning • Kitchen • Heating • Smokers • Parking •
          Balcony • Animal friendly
        </S.Description>
        <S.Price>
          R$3,000<span>/mês</span>
        </S.Price>
      </S.Info>
    </S.Room>
  );
};
